import {Routes,Route} from 'react-router-dom';
import {HomePage,LoginPage} from './pages/Home.js';
function App() {
  return (
    <>
    <Routes>
      <Route path='/' element='HomePage'></Route>
    </Routes>
    </>
  );
}

export default App;
